    false,nt"url": null,nt"notes": "Digitial imagery, mpegs and jpegs, captured
    from mini-DV magnetic videotapes collected with an underwater 3-chip CCD color video
    camera, deployed from the research submersible, Clelia (owned by Harbor Branch Oceanographic
    Inst.). Digital clips captured at a minimum of 150 dpi; mpeg file sizes generally
    range from 0.5 to over 2 Mb. Digital Imagery Captured from Videotapes Recorded during
    2001 Clelia Submersible Dives to the Oculina Banks Deep Sea Coral Reefs. The data
    presented in the Oculina Banks Geographic Information System (OGIS) was collected
    as part of a cooperative project between: the National Oceanographic and Atmospheric
    Administration's (NOAA) Undersea Research Program, NOAA Fisheries (also primary
    sponsor of OGIS), NOAA Ocean Service, NOAA Ocean Exploration Program, the U.S. Geological
    Survey (USGS)-- Coastal and Marine Geology Program, Harbor Branch Oceanographic
    Institution (HBOI) and Florida State University. An Oculina Geographic Information
    System (OGIS) provides a comprehensive, interactive data source for the Oculina
    Banks Habitat Area of Particular Concern (OHAPC), a marine protected area off the
    east coast of Florida in 70 to 120 meters of water depth. Data layers include; multi-beam
    bathymetry, single-beam bathymetry, sidescan mosaics, sediment analyses, resulting
    interpretative maps of habitat types, video and still imagery from submersible (human
    occupied and remotely operated vehicles) dive transects and point counts (fish and
    habitat cover), and dive narratives. This metadata record relates to images captured
    from videotapes recorded during the 2001 "Islands in the Stream" Expedition, on
    fourteen "Clelia" submersible dives.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
